import React from "react";

export default props => {
    const cb = props.quandoClicar
    return (
        <div>
            <div>Filho</div>
            <button onClick={_ => cb('Joao' , 15 , true)}>
                Fornecer Informacoes
            </button>
        </div>
    )
}
